import React, { Component } from 'react';
import GPDHomeScreen from './components/home_screen/GPDHomeScreen.js';

class App extends Component{
  render() {
    return (
          <BrowserRouter>
            <div className="App">
              <Navbar />
              <Switch>
                <Route exact path="/" component={GPDHomeScreen} />
              </Switch>
            </div>
          </BrowserRouter>
    );
  }
}
export  default App;
